import React from 'react';
import Carousel from 'react-bootstrap/Carousel';

const SponsorsCarousel = () => {
  // Replace the names with your sponsor/partner/certification names
  const sponsorNames = ['AMII', "HSDS", "UN", "Alberta Innovates", "Alberta Catalyzer", "IFPO"];

  return (
    <Carousel>
      {sponsorNames.map((name, index) => (
        <Carousel.Item key={index}>
          <div className="d-flex justify-content-center align-items-center carousel-item">
            <h3>{name}</h3>
          </div>
        </Carousel.Item>
      ))}
    </Carousel>
  );
};

export default SponsorsCarousel;
